import * as style from "../../css/light/focusedList";

export default function FocusedHistory() {
  return (
    <div style={{height: "100%"}}>
      <div style={style.focusedOtherTitle}>Profile History</div>
      <div style={style.focusedDivider}/>
      <div style={style.focusedHistoryContainer}>Add Content Here</div>
    </div>
  )
}
